import React from 'react'
import './HomePage.css'

class Home extends React.Component{

    render(){
        return( 
            <div class="header">
                <h1>Browser Movies</h1>
                <p1> Movies</p1>
                <p2> TV-Shows</p2>
                <p3>Latest</p3> 
            </div>
        )
    }
};

export default Home;
